import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import PastelImg002 from '../../../PastelImg/pastch002.jpg';
import { emailExiste, nombreExiste } from './tu_ruta_hacia_las_funciones_de_validacion'; // Reemplaza con la ruta correcta hacia las funciones de validación

function Regis() {
    const [formData, setFormData] = useState({
        nickname: '',
        correo: '',
        password: '',
        rol: 'USUARIO', // Establecer el rol por defecto como "USUARIO"
    });

    const [errores, setErrores] = useState({
        correo: '',
        nickname: '',
    });

    const validarCorreo = async (correo) => {
        try {
            await emailExiste(correo);
            return ''; // No hay error, correo disponible
        } catch (error) {
            return 'El correo ya existe'; // Error, correo ya registrado
        }
    };

    const validarNombre = async (nickname) => {
        try {
            await nombreExiste(nickname);
            return ''; // No hay error, nombre disponible
        } catch (error) {
            return 'El nombre ya existe'; // Error, nombre ya registrado
        }
    };

    const handleInputChange = async (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value,
        });

        if (name === 'correo') {
            const errorCorreo = await validarCorreo(value);
            setErrores({
                ...errores,
                correo: errorCorreo,
            });
        } else if (name === 'nickname') {
            const errorNombre = await validarNombre(value);
            setErrores({
                ...errores,
                nickname: errorNombre,
            });
        }
    };

    const handleSubmit = async (e) => {
        e.preventDefault();

        // Verifica si hay errores antes de enviar el formulario
        if (errores.correo || errores.nickname) {
            alert('Por favor, corrija los errores antes de enviar el formulario');
            return;
        }

        try {
            const response = await fetch('http://localhost:8000/api/guardarRegistro', {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json',
                },
                body: JSON.stringify(formData),
            });

            if (response.ok) {
                console.log('Registro exitoso');
                alert('¡Registro exitoso!');
            } else {
                console.error('Error en el registro');
                alert('Error en el registro');
            }
        } catch (error) {
            console.error('Error en la solicitud:', error);
        }
    };

    return (
        <div>
            <div className="container-ini">
                <div className="right-ini">
                    <img className='img001' src={PastelImg002} alt='' />
                </div>
                <div className="left-ini">
                    <div className="div-ini">
                        <section className="form003 fondo002">
                            <div className="form004">
                                <div className="form005">
                                    <h3>Crea tu cuenta.</h3>
                                    <form action="" className="form006">
                                        <div className="input003">
                                            <input
                                                type="text"
                                                name="correo"
                                                id="correo"
                                                placeholder="Correo Electronico"
                                                className="input004"
                                                value={formData.correo}
                                                onChange={handleInputChange}
                                                required
                                            />
                                            {errores.correo && <p className="error">{errores.correo}</p>}
                                        </div>
                                        <div className="input003">
                                            <input
                                                type="text"
                                                name="nickname"
                                                id="nickname"
                                                placeholder="Nombre Completo"
                                                className="input004"
                                                value={formData.nickname}
                                                onChange={handleInputChange}
                                                required
                                            />
                                            {errores.nickname && <p className="error">{errores.nickname}</p>}
                                        </div>
                                        <div className="input003">
                                            <input
                                                type="password"
                                                name="password"
                                                id="password"
                                                placeholder="Contraseña"
                                                className="input004"
                                                value={formData.password}
                                                onChange={handleInputChange}
                                                required
                                            />
                                        </div>
                                        {/* Campo oculto para el rol */}
                                        <input type="hidden" name="rol" value={formData.rol} />
                                        <button href="/Iniciar-Sesion" type="submit" className="btn004" onClick={handleSubmit}>
                                            Crear cuenta
                                        </button>
                                    </form>
                                    <p>
                                        Inicia sesión,<h1> </h1>
                                        <Link to="/Iniciar-Sesion" className="link002 link003">ahora!</Link>
                                    </p>
                                </div>
                            </div>
                        </section>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Regis;
